import React from 'react';
import { makeStyles } from '@material-ui/core';
import { ReactComponent as ABCLogo } from '../assets/companyLogo.svg';
import { ReactComponent as HRCLogo } from '../assets/hrcLogo.svg';
import { pxToRem } from '../utils/theme';
import { CenterFocusStrong } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
    Header: {
        display: 'flex',
        paddingBlock: '10px',
    },
    ABCCOntainer: {
        display: 'flex',
    },
    ABCLogo: {
        top: pxToRem('20px'),
        left: pxToRem('30px'),
        width: pxToRem('44px'),
        height: pxToRem('46px'),
        // paddingTop: pxToRem('10px'),
        // background: '#CD7925 0% 0% no-repeat padding-box',
    },
    ABCText: {
        font: 'normal normal bold 39px/50px Futura PT',
        color: '#FFFFFF',
        // display: 'flex',
    },
    HRCLogo: {
        position: 'absolute',
        top: '0%',
        width: '100%',
        textAlign: 'center',
        paddingBlock: '10px'
    },
}));

const Header = (props) => {
    const classes = useStyles();
    return (
        <div className={classes.Header}>
            <div className={classes.ABCCOntainer}>
                <div className={classes.ABCLogo}>
                    <ABCLogo/> 
                </div>
                <div className={classes.ABCText}>
                    ABC Products
                </div>
            </div>
            <div className={classes.HRCLogo}>
                <HRCLogo/>
            </div>
        </div>
    )
}

const LandingPage = (props) => {
    return (
        <div>
            <Header/>
        </div>
    )
}

export default LandingPage;
